import React, { Component } from 'react'

export class WorkItem extends Component {
    render() {
        const { title, excerpt } = this.props.work;
        return (
            <div>
                <h2>{ title.rendered }</h2>
                <div>{ excerpt.rendered }</div>
            </div>
        )
    }
}

export default WorkItem
